import classes from "./LoginErrorDialog.module.css";

function LoginErrorDialog(props) {

    function cancelHandler() {
        props.onCancel();
    }


    return (
        <div className={classes.errordialog}>
            <p>Are you Sure?</p>
            <button className={classes.btn + " " + classes.btnalt} onClick={cancelHandler}>
                Cancel
            </button>
            <button className={classes.btn} onClick={cancelHandler}>Confirm</button>

        </div >
    );
}

export default LoginErrorDialog
